function CustomerCare() {
    return (
        <div>
            <p><span style={{color: ""}} class="material-symbols-outlined">contact_support </span>Call us On: +254 72033 6009</p>
            <p><span style={{color: "brown"}} class="material-symbols-outlined">alternate_email</span>Email Us On: deliciousard@gmail.com</p>
            <p><span style={{color: "blue"}} class="material-symbols-outlined">sms</span>SMS line: +254 72033 6009</p>
        </div>
    )
}

export default CustomerCare;
